def _get_grouper(
    obj,
    key=None,
    axis=0,
    level=None,
    sort=True,
    observed=False,
    mutated=False,
    validate=True,
):
    group_axis = obj._get_axis(axis)

    if level is not None:
        if isinstance(group_axis, MultiIndex):
            if is_list_like(level) and len(level) == 1:
                level = level[0]

            if key is None and is_scalar(level):
                key = group_axis.get_level_values(level)
                level = None
        else:
            if is_list_like(level):
                nlevels = len(level)
                if nlevels == 1:
                    level = level[0]
                elif nlevels == 0:
                    raise ValueError("No group keys passed!")
                else:
                    raise ValueError("multiple levels only valid with MultiIndex")

            if isinstance(level, str):
                if obj.index.name != level:
                    raise ValueError(
                        "level name {} is not the name of the index".format(level)
                    )
            elif level > 0 or level < -1:
                raise ValueError("level > 0 or level < -1 only valid with MultiIndex")

            level = None
            key = group_axis

    if isinstance(key, list):
        if level is not None:
            keys = [key]
            level = [level]
        else:
            keys = key
            level = [None] * len(keys)

    # Create the Groupings for each key
    groupings = []
    exclusions = []

    for i, (gpr, lvl) in enumerate(zip(keys, level)):
        if isinstance(gpr, Grouper):
            binner, grouper, obj = gpr._get_grouper(obj, validate=False)
            if gpr.key is None:
                groupings.append(grouper)
                exclusions.append([])
            else:
                groupings.append(grouper)
                exclusions.append({gpr.key})
        elif isinstance(gpr, BaseGrouper):
            groupings.append(gpr)
            exclusions.append([])
        elif isinstance(gpr, list):
            keys = obj._get_axis(axis)
            groupings.append(obj.groupby(keys, axis=axis) if axis != 0 else obj.groupby(lvl))
            exclusions.append([])
        elif isinstance(gpr, tuple):
            keys = obj._get_axis(axis)
            groupings.append(obj.groupby(keys, axis=axis) if axis != 0 else obj.groupby(lvl))
            exclusions.append({gpr})

    if len(groupings) == 0 and len(obj):
        raise ValueError("No group keys passed!")
    elif len(groupings) == 0:
        groupings.append(Grouping(Index([], dtype="int"), np.array([], dtype=np.intp)))

    # create the internals grouper
    grouper = BaseGrouper(group_axis, groupings, sort=sort, mutated=mutated)
    return grouper, exclusions, obj
